import { NavLink } from "react-router-dom";

export default function TestCaseItem({ event }) {
  return (
    <div className="tbody">
      <div className="tr">
        <p>
          <NavLink
            to={`/dashboard/folder/${event.id}`}
            className={({ isActive }) => (isActive ? "active" : "")}
          >
            {event.id}
          </NavLink>
        </p>
        <p>
          <NavLink
            to={`/dashboard/folder/${event.id}`}
            className={({ isActive }) => (isActive ? "active" : "")}
          >
            {event.title}
          </NavLink>
        </p>
      </div>
    </div>
  );
}
